import styled from 'styled-components';

const Pinpoint = styled.div`
  display: flex;
  width: 12.1vw;
  flex-direction: column;
  width: 12.1vw;
  position: absolute;
  cursor: pointer;
  color: #000000;
  text-align: center;
  transition: 0.2s ease-in-out;  
  
  left: ${position.left};
  top: ${position.top};
  /* Ou pode fazer conta: margin: ${({marginX, marginY}) => `${marginY + marginX}px`}; */
`;

export default Pinpoint
